import React, { Component } from 'react';
import { render } from 'react-dom';
import { Carousel } from 'antd';
import 'antd/dist/antd.css';
import './custom-style.css';
class Main extends Component {
  render(){
    const settings = {
      dots: true,
      arrows: true,
      prevArrow: <RightOutlined />,
      nextArrow: <LeftOutlined />,
      autoplay: true,
    };
    return(
      <div>
        <Carousel {...settings}>
          <div><img src="https://d3p0bla3numw14.cloudfront.net/images/brand-page/tipe-unit/brand-page-tipe-unit-aubree-1488269878.jpg" alt=""/></div>
          <div><img class="img-responsive wp-image-37753" src="https://d3p0bla3numw14.cloudfront.net/news-content/img/2017/05/31160707/20170530_061215_harianterbit_JA_Connexion.jpg"/></div>
          <div><img src="https://d3p0bla3numw14.cloudfront.net/primary_property/project/1391/1493384333_facility_61391.jpg"/></div>
        </Carousel>
      </div>
    );
  }
};

render(<Main />, document.getElementById('root'));

export default Main
